const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [tooltips, setTooltips] = useState([]);

  const addTooltip = (tooltip) => {
    setTooltips((prevTooltips) => [...prevTooltips, tooltip]);
  };

  const removeTooltip = (tooltip) => {
    setTooltips((prevTooltips) => prevTooltips.filter((t) => t !== tooltip));
  };

  const currentTooltip = useRef(null);

  useEffect(() => {
    if (currentTooltip.current) {
      currentTooltip.current.setState({ isOpen: false });
    }

    currentTooltip.current = tooltips[tooltips.length - 1];
  }, [tooltips]);

  return (
    <TooltipContext.Provider value={{ addTooltip, removeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

