You can use the `sort()` method on the `rows` property of the `tbody` element.

```
function sortTable(column) {
  var tbody = document.querySelector("table tbody");
  var rows = Array.from(tbody.rows);
  rows.sort(function(a, b) {
    var aText = a.cells[column].innerText;
    var bText = b.cells[column].innerText;
    if (column == 0) {
      return aText.localeCompare(bText);
    } else if (column == 1) {
      return parseInt(aText) - parseInt(bText);
    } else {
      return aText.localeCompare(bText);
    }
  });
  for (var i = 0; i < rows.length; i++) {
    tbody.appendChild(rows[i]);
  }
}

document.querySelectorAll("table thead th").forEach(function(th, i) {
  th.addEventListener("click", function() {
    sortTable(i);
  });
});
